import React from "react";
import "./VideoFooter.css"; import MusicNoteIcon from '@mui/icons-material/MusicNote';
function VideoFooter() {
return (
<div classname="videoFooter___text">
<p>Descrição do Vídeo</p>
<div className="videoFooter"> <h3>@ademilton Felipe</h3> <div className="videoFooter music"> <MusicNoteIcon clasName="videoFooter_icon"/> <div className="videoFooterMusic text"> <p>Título da musica</p>
</div>
</div>
</div>
<img
className="videoFooter__record"
alt="Imagem de um vinil girando"
src="https://poqlymuephttfsljdabn.supabase.co/storage/v1/object/public/jornadadev/vinil.png"
/>
</div>
);
}
export default VideoFooter;
